webpackJsonp([0xf25e9dd49907],{1071:function(e,n){e.exports={data:{markdownRemark:{fileAbsolutePath:"/home/luanorlandi/git/angeloocana/src/pages/blog/vim/vim-help-commands.fr.md",html:'<p>Vim est un ancien éditeur de texte d’école, il fonctionne dans la console, c’est plus rapide de tous.\nC’est la meilleure option pour accéder aux serveurs via la commande de ligne.</p>\n<h2>Basic commands</h2>\n<p><code>Y</code> Copy line.</p>\n<p><code>v</code> Select lines pressing arrows.</p>\n<p><code>y</code> Copy lines.</p>\n<p><code>d</code> Cut lines.</p>\n<p><code>P</code> Paste before current line.</p>\n<p><code>p</code> Paste.</p>\n<p><code>/&#x3C;span>textToSearch&#x3C;/span></code> Search.</p>\n<p><code>n</code> Go to the next match.</p>\n<p><code>N</code> Go to previous match.</p>\n<p><code>r&#x3C;span>L&#x3C;/span></code> Replace next character with ‘L’.</p>\n<p><code>:%s/&#x3C;span>search&#x3C;/span>/&#x3C;span>replace&#x3C;/span>/gc</code> Search and Replace.</p>\n<p><code>:w</code> Write changes (Save).</p>\n<p><code>:q</code> Quit.</p>\n<p><code>i</code> insert text mode.</p>\n<p><code>o</code> create a new line and enable insert text mode.</p>\n<p><code>:set hlsearch</code> high light text search.</p>\n<p><code>:set incsearch</code> It enables searching while typing.</p>\n<p><code>&#x3C;span>12&#x3C;/span>G</code> Go to line 12.</p>\n<p><code>gg</code> Go to the top of the file.</p>\n<p><code>G</code> Go to the end of the file.</p>\n<p><code>:cd &#x3C;span>path&#x3C;/span></code> Change the working directory. Files can now be opened with relative paths. Use TAB and arrows to autocomplete directory names.</p>\n<p><code>:pwd</code> Shows the working directory.</p>\n<p><code>:e .</code> List working directory files and folders.</p>\n<p><code>:e &#x3C;span>file-name</code> Opens the file.</p>\n<p><code>dd</code> Delete line.</p>\n<p><code>u</code> Revert changes.</p>\n<p><code>v</code> Select text.</p>\n<p><code>V</code> Select Lines.</p>\n<p><code>d</code> Delete selected text.</p>\n<p><code>c</code> Delete selected text and go into Insert mode.</p>\n<p><code>:b &#x3C;span>file-name&#x3C;/span></code> Switch to buffer (try TAB and arrows as well).</p>\n<p><code>:bp</code> Previous buffer.</p>\n<p><code>h</code> Move one character to the left.</p>\n<p><code>l</code> Move one character to the right.</p>\n<p><code>j</code> Move one line upward.</p>\n<p><code>k</code> Move one line down.</p>\n<h2>Windows</h2>\n<p><code>ctrl-w s</code> Split window horizontally.</p>\n<p><code>ctrl-w v</code> Split vertically.</p>\n<p><code>ctrl-w j</code> Move focus down.</p>\n<p><code>ctrl-w k</code> Move focus up.</p>\n<p><code>ctrl-w j</code> Move buffer up one window.</p>\n<p><code>ctrl-w k</code> Move buffer down one window.</p>\n<p><code>ctrl-w c</code> Close window.</p>\n<p><code>ctrl-w o</code> Close all but current.</p>\n<p><code>ctrl-w w</code> Cycle focus.</p>\n<p><code>ctrl-w p</code> Focus previous window.</p>\n<h2>Indent</h2>\n<p><code>gg=G</code> Indent entire file.</p>\n<p><code>Vjj></code> Indent mutiple lines.</p>\n<h2>Line number</h2>\n<p><code>:set number</code> Show line numbers.</p>\n<p><code>:highlight LineNr ctermfg=grey</code> Change line numbers color.</p>\n<p><code>:set cursorline</code> Show current line.</p>\n<h2>Plugins</h2>\n<h3>Typescript Syntax for Vim</h3>\n<p><a target=\'_blank\' href=\'https://github.com/leafgarland/typescript-vim\'>https://github.com/leafgarland/typescript-vim</a></p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    <span class="token function">git</span> clone https://github.com/leafgarland/typescript-vim.git ~/.vim/bundle/typescript-vim\n</code></pre>\n      </div>\n<h3>Tsuquyomi: Make your Vim a TypeScript IDE.</h3>\n<p><a target=\'_blank\' href=\'https://github.com/Quramy/tsuquyomi\'>https://github.com/Quramy/tsuquyomi</a></p>\n<div class="gatsby-highlight">\n      <pre class="language-bash"><code>    <span class="token comment"># Install and compile procvim.vim</span>\n    <span class="token function">git</span> clone https://github.com/Shougo/vimproc.vim.git ~/.vim/bundle/vimproc.vim\n    \n    <span class="token function">cd</span> ~/.vim/bundle/vimproc.vim\n    \n    <span class="token function">make</span>\n\n    <span class="token function">popd</span>\n\n    <span class="token comment"># Install tsuquyomi</span>\n    <span class="token function">git</span> clone https://github.com/Quramy/tsuquyomi.git ~/.vim/bundle/tsuquyomi\n</code></pre>\n      </div>',excerpt:"Vim est un ancien éditeur de texte d’école, il fonctionne dans la console, c’est plus rapide de tous.\nC’est la meilleure option pour accéder…",fields:{tagSlugs:[{tag:"Text Editor",link:"/fr/tags/text-editor/"}],slug:"/fr/blog/vim/vim-help-commands/",readNextPosts:[{excerpt:"Cette erreur se produit lorsque vous regardez de nombreux fichiers dans linux. Vous pouvez recevoir un message d’erreur comme ceci: error…",frontmatter:{title:"Correction de l'erreur ENOSPC",date:"2017-09-03"},fields:{slug:"/fr/blog/linux/arch/fix-enospc-error/",langKey:"fr"}},{excerpt:"Tests, prononciation correcte, conseils et plus encore. Apprenez et contribuez à cette collection de contenu gratuit pour apprendre l…",frontmatter:{title:"Apprendre l'anglais (liens)",date:"2017-10-16"},fields:{slug:"/fr/blog/languages/english/learn-english-links/",langKey:"fr"}},{excerpt:"Si vous voulez apprendre cette langue merveilleuse, ici vous trouverez ma collection de liens avec du matériel gratuit pour apprendre le…",frontmatter:{title:"Apprendre le Français (Liens)",date:"2017-08-03"},fields:{slug:"/fr/blog/languages/french/learn-french-links/",langKey:"fr"}}]},frontmatter:{youtubeId:null,title:"Commandes d'aide Vim",tags:["Text Editor"],date:"2017-08-08",structuredData:null}}},pathContext:{path:"/fr/blog/vim/vim-help-commands/",langKey:"fr"}}}});
